  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:24.312633\",\n\t\"name\": \"horicon-national-wildlife-refuge-narrative-report-january-april-1962\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1962.
  The report begins by summarizing the weather, water, and habitat conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and vegetation control. Resource management is outlined; topics include
  grazing, fur harvesting, and commercial fishing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, and safety.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
